import React from "react";

import "./HomeBanner.scss";

export type HomeBannerProps = {
  cx?: string;
  onClick?: any;
};

export const HomeBanner: React.FC<HomeBannerProps> = ({
  cx = "",
  children,
  onClick,
}) => {
  return cx === "close" ? (
    <div
      className="HomeBanner close"
    >
      <img
        src="data:img/png;base64,"
        alt=""
      />
      <span>{children}</span>
    </div>
  ) : (
    <div
      className={`HomeBanner ${cx}`}
      onClick={() => {
        onClick();
      }}
    >
      <div className="l" />
      <span>{children}</span>
      <div className="r" />
    </div>
  );
};
